INSERT INTO `frase` VALUES ('207', '0', 'Bruciata la sede del del partito democratico mentre i reparti antisommossa si sono ritirati dalla dalla citta\' .');
INSERT INTO `frase` VALUES ('208', '1', 'Valona in mano ai ai dimostranti .');
INSERT INTO `frase` VALUES ('209', '2', 'Slitta a Tirana la decisione sullo sullo stato di emergenza .');
INSERT INTO `frase` VALUES ('210', '3', 'Il Governo di Berisha appare in difficolta\' .');
INSERT INTO `frase` VALUES ('211', '4', 'Ha un nome dolce l\' ultima tappa prima di entrare a Valona .');
INSERT INTO `frase` VALUES ('212', '5', 'La Collina degli degli Ulivi , in albanese Chafa Kushojviz .');
INSERT INTO `frase` VALUES ('213', '6', 'Questa _ ancora \' terra di nessuno \' , sotto , sulla sulla discesa che schiude l\' orizzonte al al mare , ci sono barricate , bagliori di fuochi e gente inferocita .');
INSERT INTO `frase` VALUES ('214', '7', 'Valona _ in mano alla alla folla , fuori da ogni controllo , la polizia _ scomparsa , rintanata nelle nelle caserme .');
INSERT INTO `frase` VALUES ('215', '8', 'Lo stato di emergenza _ nei nei fatti .');
INSERT INTO `frase` VALUES ('216', '9', 'I posti di blocco cominciano ad appena 60 chilometri dalla dalla capitale e negli negli altri 80 di strade infami fra Tirana e il porto sull\' sull\' Adriatico si toccano tutte le stazioni della della rivolta albanese .');
INSERT INTO `frase` VALUES ('217', '10', 'Kavaje , Lushinje , Fier , ogni citta\' con le sue \' piramidi finanziarie \' fallite , gli assalti ai ai municipi e alle alle stazioni di polizia , le sassaiole , gli incendi .');
INSERT INTO `frase` VALUES ('218', '11', 'Questa _ una Repubblica indipendente , urlano i valonesi trincerati dietro carcasse di auto rovesciate , bidoni e travi di legno affastellate per bloccare la strada .');
INSERT INTO `frase` VALUES ('219', '12', 'Non si passa .');
INSERT INTO `frase` VALUES ('220', '13', 'Piovono pietre e insulti , anche contro gli stranieri e gli italiani .');
INSERT INTO `frase` VALUES ('221', '14', 'Dalla Dalla rabbia dei dei valonesi non si salva niente e nessuno .');
INSERT INTO `frase` VALUES ('222', '15', 'Ieri _ caduto l\' ultimo palazzo del del potere ancora intatto , la sede locale del del Partito democratico del del presidente Sali Berisha .');
INSERT INTO `frase` VALUES ('223', '16', 'Tutto _ cominciato con i funerali di Artur Rustemi , 30 anni , uno dei dei due morti nella nella rivolta di lunedi\' , quando dopo il linciaggio di una ventina di poliziotti _ arrivata la vendetta delle delle squadre antisommossa .');
INSERT INTO `frase` VALUES ('224', '17', 'Ma ieri la folla aveva campo libero e si _ sfogata contro ogni simbolo del del potere centrale , inviperita per i morti e i feriti , eccitata dalle dalle dichiarazioni della della famiglia Rustemi , una di quelle piu\' in vista in citta\' e che vanta una lontana parentela con Avni Rustemi , rivoluzionario degli degli anni 20 assassinato dopo una sommossa contro Re Zog .');
INSERT INTO `frase` VALUES ('225', '18', 'Mio fratello _ stato ucciso alle alle spalle - ha dichiarato Cezair Rustemi - le poltrone di Berisha e dei dei suoi affondano nel nel sangue dei dei nostri morti .');
INSERT INTO `frase` VALUES ('226', '19', 'Valona la ribelle non si piega a Berisha e neppure ai ai manganelli , non crede alle alle promesse di rimborso del del Governo , vuole regolare da se\' e alla alla sua maniera i conti in rosso lasciati dalle dalle finanziarie fallite .');
INSERT INTO `frase` VALUES ('227', '0', 'Ma come ?');
INSERT INTO `frase` VALUES ('228', '1', 'Qui si _ aperto un \" buco \" di almeno 300 milioni di dollari depositati nella nella piramide della della Gjallica dove sono affluiti i soldi dei dei piccoli risparmiatori ma soprattutto milioni di dollari di affari illeciti , dal dal narcotraffico , alla alla prostituzione , al al passaggio degli degli emigranti clandestini .');
INSERT INTO `frase` VALUES ('229', '2', 'Qui sono stati riciclati i dollari della della mafia locale , e forse anche di quella italiana .');
INSERT INTO `frase` VALUES ('230', '3', 'L\' esplosione di rabbia _ genuina ma viene anche ispirata e organizzata da malavitosi , ex agenti della della Segurimi , funzionari corrotti .');
INSERT INTO `frase` VALUES ('231', '4', 'Gia\' un paio di mesi fa , quando non si parlava ancora di fallimenti , Berisha aveva fatto fuori il capo della della polizia e quasi tutti gli ufficiali delle delle dogane .');
INSERT INTO `frase` VALUES ('232', '5', 'Un brutto colpo per i traffici illegali che alimentano il benessere gonfiato del del porto .');
INSERT INTO `frase` VALUES ('233', '6', 'Non ci vuole un\' indagine particolare per intuire dove passano in Albania i canali dell\' dell\' economia sommersa .');
INSERT INTO `frase` VALUES ('234', '7', 'La Blue Guide di James Pettifer sull\' sull\' Albania avverte .');
INSERT INTO `frase` VALUES ('235', '8', 'La presenza del del crimine organizzato a Valona _ ramificata , la coltura della della canapa indiana estesa in tutto il distretto .');
INSERT INTO `frase` VALUES ('236', '9', 'Consigliamo ai ai visitatori di non passare la notte in citta\' senza l\' assistenza di qualcuno del del posto .');
INSERT INTO `frase` VALUES ('237', '10', 'Ma Valona _ anche il simbolo di una resistenza secolare a ogni tentativo di dominazione .');
INSERT INTO `frase` VALUES ('238', '11', 'La Piazza della della Bandiera _ dedicata a Ismail Kemal , il patriota che nel nel 1912 proclamo\' per la prima volta l\' indipendenza nazionale mentre il resto del del Paese era ancora sotto il controllo dell\' dell\' Impero Ottomano .');
INSERT INTO `frase` VALUES ('239', '12', 'Anche gli italiani hanno assaggiato la reazione velenosa di Valona che nel nel 1915 gli accordi segreti di Londra ci assegnarono insieme alla alla base militare sull\' sull\' Isola di Saseno .');
INSERT INTO `frase` VALUES ('240', '13', 'Nel Nel 1920 gli occupanti italiani , secondo la tradizione popolare , vennero buttati a mare , mentre durante la Seconda guerra mondiale per la resistenza partigiana alle alle truppe dell\' dell\' Asse Valona si merito\' il titolo di Citta\' degli degli Eroi .');
INSERT INTO `frase` VALUES ('241', '14', 'Eccolo Eccolo il monumento dei dei martiri in Piazza della della Bandiera , una grande scultura in bronzo dove si sono raccolti a migliaia per il funerale di Artur Rustemi , passandosi passandosi la bara di spalla in spalla avvolta in un drappo rosso con l\' aquila nera a due teste , il simbolo dell\' dell\' Albania .');
INSERT INTO `frase` VALUES ('242', '15', 'Poi un gruppo si _ staccato dal dal corteo diretto al al cimitero degli degli eroi per infilarsi infilarsi sul sul viale di Sheshi Iflamurit , la via del del porto , fiancheggiata dagli dagli edifici tipici del del regime comunista di Enver Hoxha e da case popolari , intervallate adesso dalle dalle ambiziose villette dei dei nuovi ricchi .');
INSERT INTO `frase` VALUES ('243', '16', 'Da qui _ partito l\' assalto alla alla casa che ospitava il Partito democratico , distrutta e bruciata come gia\' era avvenuto qualche giorno fa con il municipio , che nei nei piani dell\' dell\' ambasciata italiana doveva diventare la prossima sede del del consolato di Valona .');
INSERT INTO `frase` VALUES ('244', '17', 'A morte Berisha e i democratici , grida un certo Flamur quando vede avvicinarsi avvicinarsi degli stranieri .');
INSERT INTO `frase` VALUES ('245', '18', 'Qui non si trova piu\' un seguace del del Partito democratico che pure a Valona aveva vinto le ultime elezioni con l\' 88 % dei dei consensi .');
INSERT INTO `frase` VALUES ('246', '19', 'Anche Dashamir Shehi , ex vice primo ministro , un tempo uomo del del Presidente in citta\' , attacca il Governo e si oppone a misure di emergenza .');
INSERT INTO `frase` VALUES ('247', '0', 'L\' Irs ha stimato un aumento tendenziale dello dello 0,2 % della della produzione media giornaliera ;');
INSERT INTO `frase` VALUES ('248', '1', 'rispetto a gennaio _ attesa una flessione dello dello 0,4 per cento .');
INSERT INTO `frase` VALUES ('249', '2', 'Si ferma intanto la ripresina d\' autunno della della chimica .');
INSERT INTO `frase` VALUES ('250', '3', 'OTTIMISMO ALLA ALLA WTO , dove l\' importante intesa sulla sulla liberalizzazione del del mercato mondiale delle delle telecomunicazioni , un affare da 600 miliardi di dollari l\' anno , sembra ormai raggiunta .');
INSERT INTO `frase` VALUES ('251', '4', 'L\' annuncio _ atteso per oggi .');
INSERT INTO `frase` VALUES ('252', '5', 'UNA BRIGATA congiunta italo - sloveno - ungherese sara\' costituita per favorire l\' armonizzazione degli degli standard operativi di difesa .');
INSERT INTO `frase` VALUES ('253', '6', 'L\' idea _ emersa nella nella riunione alla alla Farnesina dei dei sottosegretari degli degli Esteri della della Trilaterale .');
INSERT INTO `frase` VALUES ('254', '7', 'IL PRESIDENTE DELLA DELLA CONSULTA Renato Granata ha difeso ieri , nell\' nell\' annuale conferenza stampa della della Corte , le sentenze sui sui referendum , che non sono state frutto di scelte politiche ne\' di pressioni .');
INSERT INTO `frase` VALUES ('255', '8', 'CHIESTE IN ALBANIA LE DIMISSIONI del del Governo Meksi incapace di fronteggiare la protesta per lo scandalo delle delle finanziarie pirata .');
INSERT INTO `frase` VALUES ('256', '9', 'La richiesta _ stata fatta da Gezim Zilja , leader a Valona del del Partito democratico del del presidente della della Repubblica , Sali Berisha .');
INSERT INTO `frase` VALUES ('257', '10', 'Un piano di assistenza ( 50 - 100 milioni di dollari ) cerchera\' di attutire il crack delle delle piramidi .');
INSERT INTO `frase` VALUES ('258', '11', 'La Banca mondiale in aiuto dell\' dell\' Albania .');
INSERT INTO `frase` VALUES ('259', '12', 'I finanzieri d\' assalto piu\' fantasiosi dei dei Balcani forse dovranno cambiare mestiere .');
INSERT INTO `frase` VALUES ('260', '13', 'Le pressioni della della piazza , la rivolta nella nella \" Repubblica indipendente di Valona \" , i contrasti dentro a un Governo che annaspa nelle nelle lotte interne al al Partito democratico , accuse e sospetti di ogni genere sulle sulle collusioni tra politici e traffici illegali , costringono Tirana a venire a patti con la contabilita\' dei dei bilanci e le istituzioni internazionali .');
INSERT INTO `frase` VALUES ('261', '14', 'Nella Nella capitale albanese sta arrivando una missione della della Banca mondiale con l\' obiettivo di mettere a punto un piano di assistenza tecnica e finanziaria destinato ad attutire il crack delle delle \' piramidi \' .');
INSERT INTO `frase` VALUES ('262', '15', 'La decisione _ stata presa dopo una riunione a Washington tra le organizzazioni internazionali e i principali Paesi donatori .');
INSERT INTO `frase` VALUES ('263', '16', 'L\' iniziativa , appoggiata anche dagli dagli Usa , _ promossa dall\' dall\' Unione europea che il 24 febbraio in una riunione dei dei ministri degli degli Esteri avra\' in cima all\' all\' agenda la discussione della della crisi albanese .');
INSERT INTO `frase` VALUES ('264', '17', 'L\' intervento - tra i suoi sostenitori il ministro Lamberto Dini - sara\' mirato soprattutto ad attenuare gli effetti dei dei fallimenti sulla sulla massa piu\' povera della della popolazione .');
INSERT INTO `frase` VALUES ('265', '18', 'Non c\' _ ancora una valutazione precisa sull\' sull\' entita\' del del piano ma nei nei corridoi della della diplomazia internazionale si pensa a un programma da 50 - 100 milioni di dollari , rivolto soprattutto a ossigenare le riserve della della Banca centrale impegnata nella nella difesa del del lek .');
INSERT INTO `frase` VALUES ('266', '19', 'Il crollo della della moneta - nelle nelle ultime settimane ha perso il 30 % sul sul dollaro - sarebbe il tocco finale per aprire un\' altra voragine nei nei conti dell\' dell\' Albania .');
